	def testFig1B(self):

		ca = CombineArchive()
		ca.readArchive(join(join(dirname(__file__), "files"), "CombineArchiveShowCase.omex"))
		ca.runMasterSedml()

	def testValues(self):

		ca = CombineArchive()
		ca.readArchive(join(join(dirname(__file__), "files"), "CombineArchiveShowCase.omex"))
		sedmls = ca.getAllSedmls()

		for sedml in sedmls:
			if sedml != ca.getMasterSedml():
				sedml_doc = ca.runSedml(sedml)
				data = sedml_doc.listOfOutputs.getReports()[0].getData()

				for var, values in list(self.expected_results.items()):
					for i, value in enumerate(values):
						self.assertAlmostEqual(data[var][i], value, delta=(Settings.defaultTestAbsTol+value*Settings.defaultTestRelTol))

	def testSaveAndReload(self):

		ca = CombineArchive()
		ca.readArchive(join(join(dirname(__file__), "files"), "CombineArchiveShowCase.omex"))
		ca.writeArchive(join(Settings.tempDirectory, "CombineArchiveShowCase(2).omex"))
		ca = CombineArchive()
		ca.readArchive(join(Settings.tempDirectory, "CombineArchiveShowCase(2).omex"))
		sedmls = ca.getAllSedmls()

		for sedml in sedmls:
			if sedml != ca.getMasterSedml():
				sedml_doc = ca.runSedml(sedml)
				data = sedml_doc.listOfOutputs.getReports()[0].getData()

				for var, values in list(self.expected_results.items()):
					for i, value in enumerate(values):
						self.assertAlmostEqual(data[var][i], value, delta=(Settings.defaultTestAbsTol+value*Settings.defaultTestRelTol))